    return (
        <div>
            <h1 className='text-light'>Send command in Google Cloud Pub/sub</h1>
            <div>
                <form action="">
                    <div className="d-flex justify-content-around">
                        <label htmlFor="topic">Topic</label>
                        <input type="text" placeholder="topic" name="topic" id="topic"/>
                    </div>
                    <div className="d-flex justify-content-around">
                        <label htmlFor="sub">Subscriptions</label>
                        <input type="text" placeholder="Subscriptions" name="sub" id="sub"/>
                    </div>
                    <div className="d-flex justify-content-around">
                        <label htmlFor="sub">Message</label>
                        <textarea placeholder="Message" id="message" name="message" />
                    </div>
                    btn.btn.btn-prim
                </form>
            </div>
        </div>
    );
};

export default Command;
